<html><head><meta http-equiv="Content-Type" content="text/html; charset=windows-1252">
  <script type="module" nonce="">
    addEventListener('message', function (event) {
      'use strict';
      const eventOriginDomain = event.origin === 'null' ? 'null' : new URL(event.origin).hostname;
      const isValidOrigin = ["dashboard.scale.com", "remotasks.com", "outlier.ai", "dashboard.scaleai.dev", "remotasks.dev"]
        .filter(function (validOrigin) {
          return eventOriginDomain.endsWith('.' + validOrigin) || eventOriginDomain === validOrigin;
        }).length > 0 || event.origin === window.location.origin;
      if (!isValidOrigin) return;
      if (event.data.type === 'LintRequest') {
        Promise.all(
          event.data.linters.map(function (linter) {
            return import(linter.bundleUrl)
              .then(function (plugin) {
                return plugin.lint(event.data.response, {
                  params: event.data.params,
                  textFragments: event.data.textFragments,
                  dimensions: event.data.dimensions,
                  reviewLevel: event.data.reviewLevel,
                });
              })
              .then(function (value) {
                return {
                  status: 'fulfilled',
                  value: value,
                };
              })
              .catch(function (error) {
                const reason = {};
                Object.getOwnPropertyNames(error).forEach(function (propertyName) {
                  reason[propertyName] = error[propertyName];
                });
                return {
                  status: 'rejected',
                  reason: reason,
                };
              });
          }),
        ).then(function (results) {
          event.source.postMessage(
            {
              type: 'LintResponse',
              requestId: event.data.requestId,
              results: results,
            },
            event.origin,
          );
        });
      }
    });
  </script>
